function Input({ type, text, name, value, onChange }) {
  return (
    <div className="form-control">
      <label htmlFor={name}>{text}:</label>
      <input
        type={type}
        id={name}
        name={name}
        value={value}
        onChange={onChange} // ESSENCIAL PARA FUNCIONAR
      />
    </div>
  );
}

